import httpClient from "@/utils/httpclient";
import { getDateString, formatIdDate } from "@/utils/date";
export default {
  name: "testUserDetail",
  inject: ['reload'],
  data: function data() {
    return {
      data: {},
      showMap: false,
      map: {},
      show: false,
      updateInfo: '',
      markedAt: '',
      table: null,
      tableFields: {
        orderId: {
          label: this.$t('m.cloud.order_id'),
          class: "text-center"
        },
        vehicleInfo: {
          label: this.$t('m.cloud.vehicle_info'),
          class: "text-center"
        },
        testInfo: {
          label: this.$t('m.dashboard.test_point'),
          class: "text-center"
        },
        pointTime: {
          label: this.$t('m.cloud.rese_test_drive'),
          class: "text-center"
        },
        status: {
          label: this.$t('m.cloud.status'),
          class: "text-center"
        }
      },
      idcardVerifyTime: null,
      driverLicenseverifyTime: null,
      currentPage: 1,
      totalPages: 0,
      total: 0,
      idcardBirthDate: null,
      idcardExpireDate: null,
      licenseBirthDate: null,
      licenceFristGetTime: null,
      licenseExpireDate: null
    };
  },
  mounted: function mounted() {
    var _this = this;

    httpClient.get('/api/v1/clouddrive/user/detail?userId=' + this.$route.params.id).then(function (response) {
      if (response.data.code == 200) {
        _this.data = response.data.data;
        var res = response.data.data;
        _this.idcardVerifyTime = res.idCardResponse.certificationTime ? getDateString(res.idCardResponse.certificationTime) : '';
        _this.driverLicenseverifyTime = res.driveLicenseResponse.certificationTime ? getDateString(res.driveLicenseResponse.certificationTime) : '';
        _this.idcardBirthDate = res.idCardResponse.birthDate ? formatIdDate(res.idCardResponse.birthDate) : 'N/A';
        _this.idcardExpireDate = res.idCardResponse.expireDate ? formatIdDate(res.idCardResponse.expireDate) : 'N/A';
        _this.licenseBirthDate = res.driveLicenseResponse.birthDate ? formatIdDate(res.driveLicenseResponse.birthDate) : 'N/A';
        _this.licenceFristGetTime = res.driveLicenseResponse.initialDrivingLicenseDate ? formatIdDate(res.driveLicenseResponse.initialDrivingLicenseDate) : 'N/A';
        _this.licenseExpireDate = res.driveLicenseResponse.expireDate ? formatIdDate(res.driveLicenseResponse.expireDate) : 'N/A';
      }
    });
    this.getUserOrderList(1);
  },
  methods: {
    getUserOrderList: function getUserOrderList(page) {
      var _this2 = this;

      var _page = page ? page : 1;

      httpClient.get('/api/v1/clouddrive/order/pagelistbyuser?duserid=' + this.$route.params.id + "&pageNo=" + _page).then(function (res) {
        if (res.data.code == 200) {
          _this2.filterData(res.data.data.datas ? res.data.data.datas : []);

          _this2.total = res.data.data.rowCount;
          _this2.totalPages = res.data.data.totalPages;
        }
      });
    },
    filterData: function filterData(data) {
      var _this3 = this;

      this.table = data.map(function (item) {
        var _status;

        if (item.orderStatus) {
          if (item.orderStatus === 10) {
            _status = _this3.$t('m.cloud.wait_pick_up');
          } else if (item.orderStatus === 20) {
            _status = _this3.$t('m.cloud.wait_return');
          } else if (item.orderStatus === 30) {
            _status = _this3.$t('m.cloud.returned_vehicle');
          } else if (item.orderStatus === 40) {
            _status = _this3.$t('m.cloud.complete');
          } else if (item.orderStatus === 50) {
            _status = _this3.$t('m.cloud.canceled');
          }
        }

        return {
          orderId: item.orderServiceNum,
          vehicleInfo: item.vehicleYear + " " + item.vehicleMake + " " + item.vehicleModel + " " + item.vehicleStockNum + " " + item.vehiclePlate,
          id: item.orderId,
          phone: item.phone,
          color: item.vehicleColor,
          alias: item.vehicleAlias,
          trim: item.vehicleTrim,
          plat: item.vehiclePlate,
          num: item.vehicleStockNum,
          // 库存编号
          testInfo: item.parkingName,
          pointTime: getDateString(item.appointmentStartTime),
          status: _status
        };
      });
    }
  }
};
